package leetcode;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class ValidAnagram {

    public static void main(String[] args) {
        String s = "aa", t = "";

        Map<String, Integer> sMap = new HashMap<>();
        for (char c : s.toCharArray()) {
            sMap.put(String.valueOf(c), sMap.getOrDefault(String.valueOf(c), 0) + 1);
        }

        Map<String, Integer> tMap = new HashMap<>();
        for (char c : t.toCharArray()) {
            tMap.put(String.valueOf(c), tMap.getOrDefault(String.valueOf(c), 0) + 1);
        }

        boolean returnValue = true;
        HashSet<String> objects = new HashSet<>();
        objects.addAll(sMap.keySet());
        objects.addAll(tMap.keySet());

        for (String character : objects) {
            if (sMap.get(character) != tMap.get(character)) {
                returnValue = false;
                break;
            }
        }

        System.out.println(returnValue);
    }

}
